// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Import the ERC20 implementation from OpenZeppelin
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

/**
 * @title ERC20Token
 * @dev Custom ERC20 Token with an associated liquidity pool.
 */
contract ERC20Token is ERC20 {
    // Address of the liquidity pool associated with this token
    address public liquidityPool;

    // Address of the token creator
    address public creator;

    /**
     * @dev Constructor to initialize the ERC20Token.
     * @param name_ Name of the token.
     * @param symbol_ Symbol of the token.
     * @param totalSupply_ Total supply of the token (with 18 decimals).
     * @param creator_ Address of the token creator.
     * @param liquidityPool_ Address of the associated liquidity pool.
     */
    constructor(
        string memory name_,
        string memory symbol_,
        uint256 totalSupply_,
        address creator_,
        address liquidityPool_
    ) ERC20(name_, symbol_) {
        _mint(creator_, totalSupply_);
        creator = creator_;
        liquidityPool = liquidityPool_;
    }

    /**
     * @dev Function to set the liquidity pool address.
     * @param liquidityPool_ Address of the liquidity pool.
     */
    function setLiquidityPool(address liquidityPool_) external {
        require(msg.sender == liquidityPool, "Only liquidity pool can set this");
        liquidityPool = liquidityPool_;
    }
}

